const { chromium } = require('playwright');

(async () => {
  const browser = await chromium.launch({ 
    headless: false,
    args: ['--no-sandbox']
  });
  const context = await browser.newContext();
  const page = await context.newPage();

  // Navigate to the URL
  await page.goto('https://mvp-site-app-dev-i6xf2p72ka-uc.a.run.app/');

  // Wait a bit and get the page title
  await page.waitForTimeout(3000);
  console.log('Page title:', await page.title());

  // Get the URL
  console.log('Current URL:', page.url());

  // Wait for user to interact
  console.log('Browser opened. Please authenticate manually.');
  console.log('When done, type "done" in this terminal or just tell me.');

  // Keep the process running
  await page.waitForTimeout(60000);

  await browser.close();
})();
EOF
